import React from 'react';
import Nav from '/../components/Nav/Nav'; // Caminho corrigido para o Nav
import Footer from '/../components/Footer/Footer'; // Caminho corrigido para o Footer

const AboutPage = () => {
  return (
    <div>
      <Nav />
      <main>
        <h1>Quem Somos</h1>
        <p>Conteúdo sobre a empresa ou organização.</p>
      </main>
      <Footer />
    </div>
  );
};

export default AboutPage;
